.: Plot :.

Tsuda is an insignificant salaryman.He completely dedicates himself to his job at a Tokyo insurance company,and the little time left to his girlfriend Hizuru.
In a work affair,Tsuda enters a boxe gym and meets Kojima,an old college friend.Kojima begins to visit Tsuda\'s girlfriend more and more often.Beacause of this Tsuda gets close to the boxe world,in order to take revenge on his ex-friend,and regain Hizuru\'s love.But she will rebel to the esitations of the two men,who will fight each other in a final battle,leading to a deep and definitive mutation.

